import { useEffect } from 'react';
import './App.css';
import { getPost } from './REDUX/action/action';
import Navbar from "./components/Nav Panel/Navbar"
import {useDispatch} from "react-redux"

const dispatch = useDispatch()

useEffect(()=>{
    dispatch(getPost())
}, [dispatch])

function App() {
  return (
    <div className="App">
      <Navbar/>
    </div>
  );
}

export default App;
